import escolhaImg from "../../assets/img/escolha.svg";

const Cliente = () => {

    return (
        <div>
            <div className="container-add">
                <Link to="/add-cliente" className="btn mb-4 btn-lg">
                    {" "}
                    Novo Cliente{" "}
                </Link>
                <img src={escolhaImg} alt="Header Img" />
            </div>
        </div>
    )
}

export default Cliente;
